import React from 'react';
import ReactDOM from 'react-dom';
var name = "Sultan"
var age = "20"



ReactDOM.render(
    <>
    <h1> {`My name is ${name} having age ${age}`}</h1>
 
    </>
    ,
    document.getElementById("root")
);
